export const typesPosts = {
    POST: {
      PUSH: 'POST.PUSH',
      GET: 'POST.GET'
    },
  }
  
  export const postPush = data => ({
    type: typesPosts.POST.PUSH,
    data
  })
  
  export const userNameSuccess = data => ({
    type: typesPosts.POST.GET,
    data
  })
